    public static class Solution
    {
        public static int LengthOfLongestSubstring(string s)
        {
            int left = 0;
            int maxLen = 0;
            var seen = new HashSet<char>();
            
            for (int right = 0; right < s.Length; right++)
            {
                ShowWindow(s, left, right, maxLen);
                // if duplicate — shrink window from the left
                while (seen.Contains(s[right]))
                {
                    seen.Remove(s[left]);
                    left++;
                }
            
                seen.Add(s[right]);
                maxLen = Math.Max(maxLen, right - left + 1);
                ShowWindow(s, left, right, maxLen);
            }
            
            return maxLen;
        }
        
        static void ShowWindow(string s, int left, int right, int maxLength)
        {
            Console.Clear();
            Console.WriteLine($"Max length: {maxLength}");
            for (int i = 0; i < s.Length; i++)
            {
                if (i == left) Console.Write("✋🏼");
                if (i == right) Console.Write("🤚🏼");
                Console.Write(s[i]);
                
            }
            Console.WriteLine();
            Thread.Sleep(400);
        }
    }
